import React from "react";
import { Container, Menu, Segment } from "semantic-ui-react";

export const NavBar = () => {
  return (
    <Segment inverted>
      <Menu fixed='top'  inverted secondary>
        <Container>
      <Menu.Item header>
        <img src="/assets/logo.png" alt="logo" />
        E-commerce
      </Menu.Item>
        <Menu.Item name="messages" />
        <Menu.Item name="friends" />
        </Container>
       
      </Menu>
    </Segment>
  );
};
